import React from 'react';
import FormOptimizacion from './FormOptimizacion';
import '../css/optimizacion.css';
import 'bootstrap/dist/css/bootstrap.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCode } from '@fortawesome/free-solid-svg-icons'

class OptimizacionLineal extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            resultados: false,
            url: '',
        }
    }

    render(){
        return(
            <div>
                {!this.state.resultados && <FormOptimizacion onClick = {mostrarResultados}/>}
                <h1>{url}</h1>
            </div>
        )
    }
}

export default OptimizacionLineal;
